import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { solid, regular, brands, icon } from '@fortawesome/fontawesome-svg-core' // <-- import styles to be used


const Card = ({data}) => {
    console.log(data);
    

    
  if(data.length === 0) {
    return  <div>Loading...</div>
  }

    return (
        
        <div className="row m-2 gx-4">{
            data.map((item,key)=>(


                <div key={key} className="card col-md-4 mt-2">
  <div className="card-header">
  {item.title}  <FontAwesomeIcon icon={icon({name: 'coffee', style: 'solid'})} /> 
  </div>
  <div className="card-body">
    <h5 className="card-title">Special title treatment</h5>
    <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>
            
            ))
            
            }</div>
    );
}

export default Card;
